			async searchStats() {
				this.loader = 'loading'

				this.results.filter = ''
				this.results.filterB = ''

				if (this.AMBA) {
					this.results.filter = ` AND (region_id) = '0l5DtjJ6UQ1J4DxX0fdY'`
					this.results.filterB = ` AND (region_id) = '0l5DtjJ6UQ1J4DxX0fdY'`					
				}

				if (this.interior) {
					this.results.filter = ` AND (region_id) = 'MKITRJYc46G8XLR0Kjsv'`
					this.results.filterB = ` AND (region_id) = 'MKITRJYc46G8XLR0Kjsv'`					
				}

				if (this.zone) {
					this.zoneID = (await this.$axios.post('zones/search', { responsable: this.zone })).data[0].id
					this.results.filter = ` AND (zone_id) = '${this.zoneID}'`
					this.results.filterB = ` AND (assessments.zone_id) = '${this.zoneID}'`
				}

				if (this.local) {
					this.localID = (await this.$axios.post('locals/search', { title: this.local })).data[0].id
					this.results.filter = `${this.results.filter} AND (local_id) = '${this.localID}'`
					this.results.filterB = `${this.results.filterB} AND (assessments.local_id) = '${this.localID}'`
				}

				if (this.dateSince) {
					if (this.timeSince) {
						this.results.filter = `${this.results.filter} AND (date) BETWEEN '${this.dateSince} ${this.timeSince}' 
						AND '${this.dateUntil} ${this.timeUntil}'`
						
						this.results.filterB = `${this.results.filterB}
						 AND (assessments.date) BETWEEN '${this.dateSince} ${this.timeSince}' 
						AND '${this.dateUntil} ${this.timeUntil}'`
					}
					else {
						this.results.filter = `${this.results.filter} AND DATE(date) BETWEEN '${this.dateSince}' AND '${this.dateUntil}'`
						this.results.filterB = `${this.results.filterB} AND DATE(assessments.date) BETWEEN '${this.dateSince}' AND '${this.dateUntil}'`
					}
				}

				if (this.timeSince && !this.dateSince) {
					this.results.filter = `${this.results.filter} AND HOUR(date) BETWEEN '${this.timeSince}' AND '${this.timeUntil}'`
					this.results.filterB = `${this.results.filterB} AND HOUR(assessments.date) BETWEEN '${this.timeSince}' AND '${this.timeUntil}'`					
				}

				const queryFaces = (await this.$axios.post('assessments/stats/faces/value-prc', { condition: this.results.filter })).data

				this.results.statsFaces = queryFaces
				this.results.totalAssessments = (await this.$axios.post('assessments/stats/total', { condition: this.results.filter })).data[0].total
				
				this['loading'] = false
				this.loader = null

				console.log(this.results)
				
				if (!this.results.totalAssessments) {
					this.textDialogPreResults = "La búsqueda no ha devuelto ningún resultado. Intentá con otros valores."
					this.titleDialogPreResults = "¡Advertencia!"
					this.dialogPreResults = true
				}
				else {
					this.getIndicatorsCustom()
					this.getChartCustomDatesHour()
					this.getChartCustomDatesDayW()
					this.getChartCustomDatesDay()
					this.getChartCustomDatesMonth()
					this.getChartCustomM(this.results.filter)
					this.dialogResults = true
				}
			},

      formatDate (date) {
        if (!date) return null
        const [year, month, day] = date.split('-')
        return `${day}/${month}/${year}`
			},
			
